import PRODUCTS_NEW  from "../../queries/newpro";
const Newproducts = (propn) => {
    const { newproduct } = propn;
    return(
        <div className="col-xl-3 col-lg-3 col-md-3 col-sm-6 col-6">
            <div className="card text-center card-product">
                <div className="card-product__img">
                    <Link  href={`/listproduct?slug=${ newproduct.slug }-${ newproduct.id }`}>
                        <a><img src={ newproduct.image.sourceUrl} alt="Product image"/></a>
                    </Link>
                    
                </div>
                <div>
                    <h4 className="card-product__title"><a href="#">{ newproduct.name ? newproduct.name : '' }</a></h4>
                </div>
            </div>
        </div>
    );
}
Newproducts.getInitialProps = async () => {

    const res = await client.query( {
        query: PRODUCTS_NEW,
    } );

    return {
        newproduct:res.data.products.nodes
    }

};
export default Newproducts;
